import React from 'react'

const Header = (props) => {
	console.log("WAWAWEWWAA")
	console.log(props.name)
	return(
	<>
	<h1>{props.name}</h1>
	</>
	)
  }

  const Part = (props) => {
	return(
	  <>
	  <p>{props.name} {props.exercises}</p>
	  </>
	)
  }

  const Content = ({parts}) => {
	console.log(parts)
	console.log(" luuuuummahiaaaa")
	return (
	  <>

	  {parts.map(part => 
			 <li><Part key={part.id}  name={part.name} exercises={part.exercises} /></li>
		  )}

	  </>
	)
  }

  const Total = ({ parts }) =>{

	const anto = parts.reduce((a, v)=> {
		return(a + v.exercises)}, 0)
	return(
	<h3>
	number of exercises: {anto}
	</h3>
	)
  }

  const Course = ({ course }) => {
	console.log(course)
	console.log(" ahiaaaa")
	return(
	  <>
	  <ul>
	  {course.map(ciao =>
			<div >
			<Header name={ciao.name} key={ciao.id}/>
			<Content parts={ciao.parts} key={ciao.parts.id}/>
			<Total parts={ciao.parts} key={ciao.parts.id}/>
			</div>
		  )}
	  </ul>
	  </>
	)
  }

  export default Course
